import React, { Component } from "react";
import EventFeaturesItem from './EventFeaturesItem';
import SeoTitle from '../Title/SeoTitle';


class EventFeatures extends Component {
    
    render(){
        return(
        <section className="event_features_area bg-white">
            <div className="container">
                <div className="hosting_title security_title text-center">
                  <SeoTitle Title="Team Scrum" TitleP="It consists of a Product owner, the Development team and a Scrum Master. It is self-organized and multifunctional. They deliver products iteratively and incrementally." />
                </div>
                <div className="row event_features_inner pt-5">
                    <EventFeaturesItem image="leader.png"  title="Product owner" ptext="Lost the plot lurgy on your bike mate Oxford hanky panky blow off haggle golly gosh do one." 
                    />
                    <EventFeaturesItem image="meetup.png"  title="Development team" ptext="Lost the plot lurgy on your bike mate Oxford hanky panky blow off haggle golly gosh do one." 
                    />
                    <EventFeaturesItem image="chat.png"  title="Scrum Master" ptext="Lost the plot lurgy on your bike mate Oxford hanky panky blow off haggle golly gosh do one." 
                    /> 
                    
                </div>
            </div>
        </section>
        )
    }
}
export default EventFeatures;
